import React, { useState, useEffect } from 'react';
// import GetJsonUpdate from "./JsonUpdate.js"

function App() {
	let [jsonData, setJsonData] = useState(null)

	useEffect(() => {
		fetch("https://127.0.0.1:8080/api/json")
			.then(response => response.json())
			.then(data => setJsonData(data.message))
	}, [])
	return (
		{ jsonData }
	);
}

export default App;
